css:
.editor-colors {
  background-color: #ffffff;
  color: #000000;
}
.editor {
  background-color: #ffffff;
  color: #000000;
}
.editor .wrap-guide {
  background-color: #d4d4d4;
}
.editor .indent-guide {
  color: #d4d4d4;
}
.editor .invisible-character {
  color: #373b41;
}
.editor .gutter {
  background-color: #efefef;
  color: #d4d4d4;
  border-right: 1px solid #000;
  margin-right: 10px;
}
.editor .gutter .line-number.cursor-line,
.editor .gutter .line-number:hover {
  background-color: #d4d4d4;
  color: black;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: black;
}
.editor .gutter .line-number .icon-right {
  color: #000;
}
.editor .gutter .line-number .icon-right:hover {
  background: #d4d4d4;
  cursor: pointer;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #969896;
}
.editor .invisible {
  color: #000000;
}
.editor .cursor {
  color: #000000;
}
.editor .selection .region {
  background: rgba(100, 170, 255, 0.5);
}
.embedded {
  background-color: rgba(70, 100, 100, 0.05);
}
.embedded .begin,
.embedded .end {
  color: black !important;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: rgba(0, 0, 0, 0.3) !important;
}
.entity.name.type {
  color: #462dc6;
  font-weight: bold;
}
.entity.other.inherited-class {
  color: #00a155;
}
.keyword {
  color: #792dc6;
}
.keyword.control {
  color: #792dc6;
}
.keyword.operator {
  color: #000000;
}
.keyword.other.special-method {
  color: #462dc6;
}
.keyword.other.unit {
  color: #462dc6;
}
.storage {
  color: #462dc6;
  font-weight: bold;
}
.constant {
  color: #00a155;
  font-weight: bold;
}
.constant.character.escape {
  color: #00b6b8;
}
.constant.numeric {
  color: #462dc6;
}
.constant.other.color {
  color: #462dc6;
}
.constant.other.symbol {
  color: #00a155;
}
.constant.color {
  color: red;
}
.constant.rgb-value {
  color: red;
}
.variable {
  color: #4096a5;
}
.variable.interpolation {
  color: #cc0000;
}
.variable.parameter.function {
  color: #000000;
}
.invalid.illegal {
  background-color: #ff0000;
  color: #ffffff;
}
.string {
  color: #ee5ecb;
}
.string.regexp {
  color: #00b6b8;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #ff0000;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #000000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #462dc6;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #792dc6;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #cc0000;
}
.support.class {
  color: #00a155;
  font-weight: bold;
}
.support.function {
  color: #00b6b8;
}
.support.function.any-method {
  color: #462dc6;
}
.entity.name.function {
  color: #462dc6;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #462dc6;
}
.entity.name.tag {
  color: #462dc6;
  font-weight: bold;
}
.entity.other.attribute-name {
  color: #462dc6;
}
.entity.other.attribute-name.id {
  color: #462dc6;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #462dc6;
}
.meta.selector {
  color: #792dc6;
}
.meta.separator {
  background-color: #373b41;
  color: #000000;
}
.none {
  color: #000000;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #792dc6;
}
.markup.deleted {
  color: #ff0000;
}
.markup.italic {
  color: #792dc6;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #462dc6;
}
.markup.inserted {
  color: #00a155;
}
.markup.list {
  color: #ff0000;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #00a155;
}
*.rgb-value {
  color: #ff0000 !important;
}
*.rgb-value * {
  color: #ff0000 !important;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #00a155;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
